window.bookSummaryJSON = "<p>I came to warn them, but instead I put them in the line of fire.</p> <p>Now one piece of my heart is missing, while the other pieces are forced to leave behind everything they’ve ever known to protect me.</p> <p>The truth about who I am and where I came from weighs on me. Is anything real?</p> <p>All I know for sure is that the people responsible for bringing me into the world are the very ones putting the only family I have ever known in danger. But I will stop at nothing to keep them safe. I will use everything they gave me against them and risk everything to take them down.</p> <p>Little do they know, a reckoning is coming.</p> <p><i>Retribution </i>is the follow-up novel to<b> </b><i>Progeny</i>. The action and the spice in this sci-fi/ contemporary MMMFMM novel are turned up as Six and her men face the unknown. Please refer to the author’s bio for any sensitive content.</p>"; 
